
<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <title>French Cat's Docs</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
    <meta name="description" content="The documentation for all things a certain French Cat made.">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0">
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/docsify-themeable@0/dist/css/theme-defaults.css">
    <link rel="stylesheet" href="https://docs.cumcord.com/discord.css" />
</head>

<body>
    <div id="app"></div>
    <script>
        window.$docsify = {
            name: 'French Cat\'s Docs',

            loadSidebar: true,
            subMaxLevel: Infinity,
            search: {
                maxAge: 300666,
                paths: "auto",
                placeholder: "Search"
            }
        }
    </script>
    <!-- Docsify v4 -->
    <script src="https://cdn.jsdelivr.net/npm/docsify@4.12.1/lib/docsify.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/docsify/lib/plugins/search.min.js" type="text/javascript"></script>
    <script src="https://cdn.jsdelivr.net/npm/prismjs@1/components/prism-jsx.min.js" type="text/javascript"></script>
    <script src="https://cdn.jsdelivr.net/npm/docsify-copy-code"></script>
    </script>
  <script>
  if (typeof navigator.serviceWorker !== 'undefined') {
    navigator.serviceWorker.register('sw.js')
  }
</script>
</body>

</html>
